import React, { useState } from "react";
import { Grid, TextField, withStyles } from "@material-ui/core";
import useForm from "./useForm";

const styles = theme => ({
        '& .MuiTextField-root': {
                margin: theme.spacing(1),
                minWidth: 230,
        },
})

const initialFieldValues = {
        id: '',
        fullName: '',
        address: '',
        email: '',
        age: '',
        mobil: ''
}

const CustomerForm = (props) => {      

        const {
                values,
                setValues,
                handleInputChange
        } = useForm(initialFieldValues)

        return (
                <form autoComplete="off" noValidate>
                        <Grid container>
                                <Grid item xs={6}>
                                        <TextField name="id" variant="outlined" label="Id" value={values.id} onChange={handleInputChange}></TextField>
                                        <TextField name="fullName" variant="outlined" label="Full Name" value={values.fullName} onChange={handleInputChange}></TextField>
                                        <TextField name="address" variant="outlined" label="Address" value={values.address} onChange={handleInputChange}></TextField>
                                </Grid>
                                <Grid item xs={6}>
                                        <TextField name="email" variant="outlined" label="Email" value={values.email} onChange={handleInputChange}></TextField>
                                        <TextField name="age" variant="outlined" label="Age" value={values.age} onChange={handleInputChange}></TextField>
                                        <TextField name="mobil" variant="outlined" label="Mobil" value={values.mobil} onChange={handleInputChange}></TextField>
                                </Grid>
                        </Grid>
                </form>
        );
}

export default withStyles(styles)(CustomerForm);
